import React, { Component } from 'react';
import './Obruc.css';
import ObrucColor from '../assets/art/dubrovnik.jpg';
import ObrucGrey from '../assets/art/dubrovnik-2.jpg';
import ArtDisplay from '../Components/ArtDisplay';

const Text = <span>
              Roofs of dubrovnik
            </span>

class Dubrovnik extends Component {

  render() {
    return(
      <ArtDisplay title='Roofs of Dubrovnik' client='Personal work' year='2018' technique='Ink &amp; Paper' text={Text}>
        <img className="block-image mx-auto my-5" src={ObrucColor} alt="Obruc-color"></img>
        <img className="block-image mx-auto mb-5" src={ObrucGrey} alt="Obruc-grey"></img>
      </ArtDisplay>
    );
  }
}

export default Dubrovnik;
